  false,\n\t\"url\": null,\n\t\"notes\": \"A data set of simulated hydrologic fluxes
  and states from the Variable Infiltration Capacity (VIC) model, gridded to a 1/16
  degree (~6km) resolution that spans the entire country of Mexico, the conterminous
  U.S. (CONUS), and regions of Canada south of 53 degrees N for the period 1950-2013.
  Because of the consistent gridding methodology, the current product reduces transboundary
  discontinuities making it suitable for estimating large-scale hydrologic phenomena.\",\n\t\"license_title\":
